    // Helper method to register items
    // register blank TMItems
    private static BlankTMItem registerBlankTMItem(String name, BlankTMItem blankTMItem) {
        return (BlankTMItem) Registry.register(Registries.ITEM, new Identifier(SimpleTMsMod.MODID, name),blankTMItem);
    }
    // register MoveTutorItems
    private static MoveTutorItem registerMoveTutorItem(String name, MoveTutorItem moveTutorItem) {
        return (MoveTutorItem) Registry.register(Registries.ITEM, new Identifier(SimpleTMsMod.MODID, name),moveTutorItem);
    }


    // Other functions
    // Register all mod items
    public static void registerModItems() {
        SimpleTMsMod.LOGGER.info("Register Mod Items for " + SimpleTMsMod.MODID) ;


    }

    // get item by name
    public static ItemStack getItemStackByName(String name) {
        Identifier identifier = new Identifier(SimpleTMsMod.MODID, name);
        Item item = Registries.ITEM.get(identifier);
        if (item!=null) {
            return new ItemStack(item,1);
        } else {
            return ItemStack.EMPTY;
        }

    }
